import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Reporting() {
  const [lowStock, setLowStock] = useState([]);
  const [sales, setSales] = useState([]);
  const [products, setProducts] = useState([]);
  const [totalItemsBought, setTotalItemsBought] = useState(0);
  const [totalRevenue, setTotalRevenue] = useState(0);
  const [remainingWorth, setRemainingWorth] = useState(0);

  useEffect(() => {
    Promise.all([
      axios.get('/reports/lowstock'),
      axios.get('/sales'),
      axios.get('/products')
    ]).then(([lowRes, salesRes, prodRes]) => {
      setLowStock(lowRes.data);
      setSales(salesRes.data);
      setProducts(prodRes.data);

      // Calculate total items bought
      const itemsBought = salesRes.data.reduce((sum, sale) => sum + sale.quantity, 0);
      setTotalItemsBought(itemsBought);

      // Calculate total revenue (money recovered)
      const revenue = salesRes.data.reduce((sum, sale) => {
        const product = prodRes.data.find(p => p.id === sale.productId);
        return sum + (product ? product.price * sale.quantity : 0);
      }, 0);
      setTotalRevenue(revenue);

      // Calculate remaining products worth
      const worth = prodRes.data.reduce((sum, p) => sum + (p.quantity * p.price), 0);
      setRemainingWorth(worth);
    }).catch(err => console.error(err));
  }, []);

  return (
    <div>
      <h2>Reporting</h2>
      
      <h3>Low Stock Products</h3>
      <table>
        <thead><tr><th>Name</th><th>Description</th><th>Quantity</th><th>Price</th></tr></thead>
        <tbody>
          {lowStock.map(p => (
            <tr key={p.id}>
              <td>{p.name}</td>
              <td>{p.description}</td>
              <td>{p.quantity}</td>
              <td>${p.price.toFixed(2)}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h3>Sales Records Summary</h3>
      <p>Total Items Bought: {totalItemsBought}</p>
      <p>Total Money Recovered from Sales: ${totalRevenue.toFixed(2)}</p>
      <p>Total Worth of Remaining Products: ${remainingWorth.toFixed(2)}</p>

      <h3>Sales History</h3>
      <table>
        <thead><tr><th>Product ID</th><th>Quantity</th><th>Date</th></tr></thead>
        <tbody>
          {sales.map(s => (
            <tr key={s.id}>
              <td>{s.productId}</td>
              <td>{s.quantity}</td>
              <td>{s.date}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Reporting;
